import { Fragment } from "react";

function NavItem({title, url}){
    return (
      <a href={url}>
      {title}
      </a>
      );
  }

  function Logo({logo, size}){
    return(
      <img 
      src={logo}
      width={size}
      height={size}
      />
    )
  }

  function NavbarAccordian(){
    return (
        <Fragment>
            <div className="accordian">
                <div className="accordian-symbol">
                    <img src="https://svgshare.com/i/t84.svg"/>
                </div>
                <NavItem text="Home" url=""/>
                <NavItem text="Blogs" urls=""/>
                <NavItem text="Reviews" urls=""/>
                <NavItem text="Podcasts" urls=""/>
            </div>
        </Fragment>
    )
}

  export default function Navbar({}) {
    return (
      <nav className="flex justify-between"> 
        <div>
            <Logo logo={"https://u.cubeupload.com/bostonessary/phunkplain.png"} size={50}/>
        </div>
        <div className="flex justify-between">
        <NavItem title={"Home"} url={""}/>
        <NavItem title={"Blog"} url={""}/>
        <NavItem title={"Reviews"} url={""}/>
        <NavItem title={"Podcasts"} url={""}/>
        </div>
     </nav>
    );
}
